import React from "react";
import { Link } from "react-router-dom";
import SocialMedia from "../social-media/SocialMedia";

function QuickLinksSetOne(props) {
    const pageId = props.id;

    let linkObject = [
        {
            url: '/about-us',
            text: 'About Us'
        },
        {
            url: '/tickets',
            text: 'Get Tickets'
        },
        {
            url: '/key-policies',
            text: 'Key Policies'
        },
        {
            url: '/events-contests-promotions',
            text: 'Daily Events, Contests &#38; Promotions'
        },
        {
            url: '/bring-your-dog',
            text: 'Bring Your Dog'
        },
        {
            url: '/find-hotels',
            text: 'Find a Hotel'
        },
        {
            url: '/directions',
            text: 'Directions'
        },
        {
            url: '/faq',
            text: 'FAQ'
        },
        
    ]

    const linkArray = linkObject.slice(pageId-1);

    return (
        <>
        <div className="col2">
          <h3 className="col2-header">Plan Your Visit</h3>
          {pageId !== 1 ? 
          <>
            <Link className="col2-link" to="/about-us">
            About Us
            </Link>
            <br/>
          </> : null}
          {pageId !== 2 ? 
          <>
            <Link className="col2-link" to="/tickets">
              Get Tickets
            </Link>
            <br/>
          </> : null}
          {pageId !== 3 ? 
          <>
            <Link className="col2-link" to="/key-policies">
              Key Policies
            </Link>
            <br/>
          </> : null}
          {pageId !== 4 ? 
          <>
            <Link className="col2-link" to="/events-contests-promotions">
              Daily Events, Contests &#38; Promotions
            </Link>
            <br/>
          </> : null}
          {pageId !== 5 ? 
          <>
            <Link className="col2-link" to="/bring-your-dog">
              Bring Your Dog
            </Link>
            <br/>
          </> : null}
          {pageId !== 6 ? 
          <>
            <Link className="col2-link" to="/find-hotels">
              Find a hotel
            </Link>
            <br/>
          </> : null}
          {pageId !== 7 ? 
          <>
            <Link className="col2-link" to="/directions">
              Directions
            </Link>
          </> : null}
            <br/>
          {pageId !== 8 ? 
          <>
            <Link className="col2-link" to="/faq">
                FAQ
            </Link>
          </> : null}
            
            <br />
            
            <SocialMedia />
          </div>
        </>
    )
}

export default QuickLinksSetOne
